import React from 'react';
import Toolbar from './components/Toolbar';
import QuestionsList from './components/QuestionsList';
import './App.css';

function Home() {
    return(
        <>
            <Toolbar />

            <QuestionsList />

            <div className="App">
                <header className="App-header">
                </header>
            </div>
        </>
    )
}

export default Home;
